Conditionally excluding field not working in MongoDB<p>I would like to get a user from the database. My function takes in a <code>requesterId</code> which is the ID of the user requesting this data, and a <code>targetId</code> which is the user to retrieve.</p>

<p>If the requester is in the target's <code>friends</code> array (strings), the <code>phone</code> field should be included in the projection. If not, it is excluded.</p>

<p>I have come up with the following query after reading the example <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/project/#remove-example" rel="nofollow noreferrer">here</a>. However, the <code>phone</code> field is always returned no matter what. What am I doing wrong?</p>

<pre><code>  getUser: function getUser(requesterId, targetId) {
    return db.collection('users').aggregate([
      {$match: {userId: targetId}},
      {
        $project:
          {
            firstName: 1,
            phone: {
              $cond: {
                if: {friends: requesterId},
                then: "$phone",
                else: "$$REMOVE"
              }
            }
          }
      },
      {$limit: 1}
    ]).toArray();
  }
</code></pre>

<p><strong>Schema</strong> (created in Compass so no code):<br>
<code>userId</code> - String<br>
<code>firstName</code> - String<br>
<code>friends</code> - Array(String)<br>
<code>phone</code> - String</p>

<p><strong>Indices</strong>:
<em>None on this collection</em></p>

<p><strong>Example</strong>:</p>

<pre><code>/* Bob's MongoDB data */ {userId: "BobID", firstName: "Bob", friends: ["AmyID"], phone: "1234567890"}
getUser(requesterId = 'AmyID', targetId = 'BobID');
/* Result */ {firstName: "Bob", phone: "1234567890"}

/* Amy's MongoDB data */ {userId: "AmyID", firstName: "Amy", friends: ["CassieID"], phone: "9876543210"}
getUser(requesterId = 'BobID', targetId = 'AmyID');
/* Result */ {firstName: "Amy", phone: "987654321"}
</code></pre>

<p>Bob's request for Amy's user should not return her phone number because he is not in her <code>friends</code> array.</p>

